import React from "react";

const Butttons = (props) => {
  const buttons = props.id.forEach(
    (id, i) => {
      return (
        <button id={id} value={props.value[i]}>
          {props.value[i]}
        </button>
      );
    },
    () => {
      console.log(buttons);
    }
  );

  return <div id="buttons-container">{buttons}</div>;
};

export default Butttons;
